import React from "react";
import Card from "react-bootstrap/Card";

export default function Prize() {
  return (
    <Card className="prize" style={{ width: "18rem" }}>
      <Card.Header>4 Pts</Card.Header>
      <Card.Body style={{textAlign: "center"}}>
        <Card.Title>Movie Night</Card.Title>
        <Card.Text>
          You get to choose the movie. <br/> (No the Notebook) <br/> Wine and Popcorn provided.
        </Card.Text>
      </Card.Body>
    </Card>
  );
}
